import React, { Component } from 'react'



export class QuestionBox extends Component {

    state = {
        currentQuiz:null
    }

    constructor(props) {
        super(props)
    
         this.state = {
             currentQuiz:null
         }
    }
    
    componentDidMount(){
        this.setState ({
            currentQuiz: this.props
        })
    }
    

    render() {
        console.log(currentQuiz)
        return (
            <div>
            <ol type='A'>
                <li>{}</li>
                <li>{}</li>
                <li>{}</li>
                <li>{}</li>
            </ol>  
        </div>
        )
    }
}

export default QuestionBox
